  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lake Umbagog
  National Wildlife Refuge outlines Refuge accomplishments during the 1993 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  public participation. Refuge administration is outlined; information about personnel,
  volunteer programs, and funding is given. Habitat management is also covered; subjects
  include wetlands, forests, water rights, and wilderness and special areas. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, raptors, game mammals, and fisheries resources.
  The public uses of the Refuge described in this report include hunting, trapping,
  camping, and off-road vehicling. The equipment and facilities section of the report
  provides information about rehabilitation and equipment utilization and replacement.
  Cooperative programs are discussed. The Environmental Assessment (EA) and Finding
  of No Significant Impact (FONSI) for land adjacent to Lake Umbagog National Wildlife
  Refuge is attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
